import logo from "./logo.svg";
import "./App.css";
import Login from "./components/Login";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect,
  BrowserRouter,
} from "react-router-dom";
import Register from "./components/Register";

function App() {
  return (
    <BrowserRouter>
      <div>
    <Switch>
    <Route></Route>
        <Login />
        <Register />

    </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
